import React from "react";

function Clubs() {
  // Function to generate Google Maps link for a given address
  const generateMapLink = (address) => {
    const encodedAddress = encodeURIComponent(address.trim());
    return `https://www.google.com/maps/search/?api=1&query=${encodedAddress}`;
  };

  // Example address (you can replace this with your actual address)
  const address = "1600 Amphitheatre Parkway, Mountain View, CA";
  const mapUrl = generateMapLink(address);

  return (
    <footer>
      <div>
        {/* Display the address */}
        <p>Address: {address}</p>

        {/* Display the generated Google Maps link */}
        <p>
          Google Maps Link:{" "}
          <a href={mapUrl} target="_blank" rel="noopener noreferrer">
            {mapUrl}
          </a>
        </p>
      </div>

      <small>Copyright Â© 2024. Hatttrick. All Rights Reserved.</small>
    </footer>
  );
}

export default Clubs;
